import Picture from "./components/Picture"

const HomePage = () =>{
    const [data,setData] = useState({});
    
    const fetchData = ()=>{
        fetch('http://localhost:3000/posts/1')
        .then(res => res.json())
        .then(data =>{
            setData(data.data);
            console.log(data.data);
        })
    }
    
    return <div className="container">
        <List />
        <Picture/>
    </div>
}
export default HomePage;
